import React from 'react';
import Hero from '../components/Hero';
import Carousel from '../components/Carousel';
import Content from '../components/Content';

function AirflowPage(props){
return(

  <div>

          <Hero title="Airflow Workshops" />
          <Content>
          <p></p>
          <p>My boss gave me an assignment to learn and implement Airbnb's open-source tool, Airflow at our company. Airflow is a data orchestration tool that allows you to programmtically schedule jobs in order to extract, transform, or load data.
          I was able to successfully implement Airflow and taught my teammates all the interesting things (including Airflow, Docker, Kubernetes, Linux, Git, and Python) I had learned! Here's just a taste of my material :) I had a lot of fun organizing, documenting, and sharing knowledge. </p>
          </Content>
      </div>

);
}
export default AirflowPage;
